import React, { useState, useEffect } from 'react';
import ShippingProgressBar from './ShipppingSProgressBar';

function Shipping() {
  const [apiData, setApiData] = useState({ label: 'Dispatched', match: true });

  useEffect(() => {
    // Replace 'your-api-url-here' with the actual URL of your API endpoint
    fetch('your-api-url-here')
      .then((response) => response.json())
      .then((data) => {
        setApiData(data); // Assuming your API response includes 'label' and 'match' fields
      })
      .catch((error) => {
        console.error('Error fetching data from API:', error);
      });
  }, []);

  return (
    <div className="App">
      <ProgressBar apiData={apiData} />
    </div>
  );
}

export default Shipping;
